const styles = {
  margin: "10px",
  alignSelf: "right",
  background: "grey",
  borderRadius: "50%",
}

function CircularIcon(props) {
  return (
    <div style = {styles.buttonIconStyles}>
      <img scr = {"./../images/icons/" + props.type + "Icon.png"} style = {styles.imageStyles}></img>
      <p>I am a {props.type} icon!</p>
    </div>
  )
}

export default CircularIcon;
